import React, { useState } from 'react';
import './index.css'; // Import the CSS for this component
// import Header from '../Header'; // Uncomment if you want a Header here

const ContactUs = () => {
    const [formData, setFormData] = useState({
        name: '',
        email: '',
        subject: '',
        message: ''
    });
    const [status, setStatus] = useState(''); // Can be 'idle', 'loading', 'success', 'error'

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData(prevData => ({
            ...prevData,
            [name]: value
        }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setStatus('loading');

        try {
            // This is a placeholder. You'll need a backend endpoint to handle form submissions.
            // For example, a Flask endpoint, or a service like Formspree, Netlify Forms, etc.
            const response = await fetch('http://localhost:5000/contact', { // Replace with your actual endpoint
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(formData),
            });

            if (response.ok) {
                setStatus('success');
                setFormData({ name: '', email: '', subject: '', message: '' }); // Clear form
            } else {
                const errorData = await response.json();
                setStatus('error');
                console.error('Contact form submission error:', errorData);
            }
        } catch (err) {
            setStatus('error');
            console.error('Network or server error:', err);
        }
    };

    return (
        <div className="contact-page">
            {/* <Header /> Uncomment if you want a Header here */}
            <div className="contact-container">
                <h2>Get in Touch</h2>
                <p className="subtitle">We'd love to hear from you! Send us a message.</p>

                {status === 'success' && (
                    <div className="status-message success">Thank you for your message! We'll get back to you soon.</div>
                )}
                {status === 'error' && (
                    <div className="status-message error">Failed to send message. Please try again later.</div>
                )}
                {status === 'loading' && (
                    <div className="status-message loading">Sending your message...</div>
                )}

                <form onSubmit={handleSubmit} className="contact-form">
                    <div className="form-group">
                        <label htmlFor="name">Your Name</label>
                        <input
                            type="text"
                            id="name"
                            name="name"
                            value={formData.name}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <div className="form-group">
                        <label htmlFor="email">Your Email</label>
                        <input
                            type="email"
                            id="email"
                            name="email"
                            value={formData.email}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <div className="form-group">
                        <label htmlFor="subject">Subject</label>
                        <input
                            type="text"
                            id="subject"
                            name="subject"
                            value={formData.subject}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <div className="form-group">
                        <label htmlFor="message">Message</label>
                        <textarea
                            id="message"
                            name="message"
                            value={formData.message}
                            onChange={handleChange}
                            rows="6"
                            required
                        ></textarea>
                    </div>
                    <button type="submit" className="contact-button" disabled={status === 'loading'}>
                        {status === 'loading' ? 'Sending...' : 'Send Message'}
                    </button>
                </form>

                <div className="contact-info">
                    <h3>Other Ways to Reach Us:</h3>
                    <p>Email: <a href="mailto:support@garudataxai.com">support@garudataxai.com</a></p>
                    <p>Phone: +91 98765 43210</p>
                    <p>Address: 123 AI Tax Lane, Bengaluru, India</p>
                </div>
            </div>
        </div>
    );
};

export default ContactUs;
